import React from "react";
import ReactDOM from "react-dom";
import { add, sub, mul, div } from "./Calc";

ReactDOM.render(
  <>
    <ul>
      <li>
        the addition of {a} & {b} numbers {add(40, 4)}
      </li>
      <li>the subtraction of two numbers {sub(40, 4)}</li>
      <li>the multipliation of two numbers {mul(40, 4)}</li>
      <li>the division of two numbers {div(40, 4)}</li>
    </ul>
  </>,
  document.getElementById("root")
);
